import React from 'react';
import Login from './components/login';
import './styles/style.css'
import {BrowserRouter as Router,Switch,Route} from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/fodase">
          <p>fodase</p>
        </Route>
        <Route path="/">
            <Login/>
        </Route>
      </Switch>
    </Router>

  );
}

export default App;
